  false,\n\t\"url\": null,\n\t\"notes\": \"An investigation of the water resources
  of Salt Lake County Utah, was undertaken by the Water Resources division of the
  U.S. Geological Survey in July 1963. This investigation is a cooperative project
  financed equally by the State of Utah and the Federal Government in accordance with
  an agreement between the State Engineer and the Geological Survey. nThe investigation
  encompasses the collection and interpretation of a large variety of climatologic,
  horologic, and geologic data in and near Salt Lake County. \",\n\t\"license_title\":
